ANSWER:
 Informuojame, kad nuo 2022 m. rugpjūčio 1 d. buvo atnaujintos Keleivių ir bagažo vežimo Vilniaus miesto viešuoju transportu taisyklės, kuriose vairuotojams nebeliko prievolės gesinti transporto priemonės variklius. Toks sprendimas buvo priimtas, nes dėl objektyvių priežasčių nėra galimybės visais atvejais laikytis šio reikalavimo:
• pabaigus reisą ir sustojus galiniame punkte, autobusuose vyksta regeneracijos procesas, o priverstinis šio proceso stabdymas neigiamai veikia transporto priemonių techninę būklę;
• trumpalaikio sustojimo metu yra neracionalu išjungti autobuso variklį, nes prieš pradedant važiuoti yra būtina kelias minutes pastovėti užvedus variklį tam, kad oru užsipildytų hidraulinė autobuso stabdymo sistema. Trumpalaikis variklio išjungimas ir po kelių minučių įjungimas dar labiau trikdytų aplinkinių namų gyventojų ramybę;
• užvedus transporto priemonės variklį būtina palaukti kelias minutes kad užsikrautų elektroninio bilieto sistema, o kompiuteris prisijungtų prie GPS programinės įrangos.

Atkreipiame dėmesį, jog SĮ „Susisiekimo paslaugos“ neturi pareigos kontroliuoti ir užtikrinti, kad galiniuose punktuose vairuotojai gesintų transporto priemonių variklius.

Jūsų minimas Aplinkos ministerijos raštas rašytas dar galiojant senosioms taisyklėms t. y. tada, kai viešojo transporto vairuotojams dar buvo numatyta pareiga gesinti transporto priemonių variklius, o SĮ „Susisiekimo paslaugos“ darbuotojams - prievolė kontroliuoti.

